export function getChampionsImageMap() {
  const map = new Map(Object.entries(champions));
  map.set(DEFAULT, getLogoImg);
  return map;
}

export function getChampionImg(name: string): string {
  const im = getChampionsImageMap();
  return im.get(name) ? (im.get(name) as string) : (im.get(DEFAULT) as string);
}
